import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import injectHeaderStyles from './styles';
import type { User } from '../../../types/user';
import { 
  HomeIcon, 
  PlusIcon, 
  ChartIcon, 
  UsersIcon, 
  DocumentIcon, 
  KeyIcon,
  SearchIcon,
  BellIcon,
  LogoutIcon
} from '../../../components/Icons';

injectHeaderStyles();

interface HeaderProps {
  subtitle?: string;
  onLogin?: () => void;
  user?: User | null;
  onLogout?: () => void;
}

export default function Header({ subtitle, onLogin, user, onLogout }: HeaderProps){
  const [searchQuery, setSearchQuery] = useState('');
  const [showSearch, setShowSearch] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  const isManager = user?.role === 'manager';
  const isCliente = user?.role === 'cliente';

  // Menu items based on role
  const getNavItems = () => {
    if (isManager) {
      return [
        { path: '/gerenciar', label: 'Painel', icon: <HomeIcon /> },
        { path: '/criar', label: 'Criar', icon: <PlusIcon /> },
        { path: '/resultados', label: 'Resultados', icon: <ChartIcon /> },
        { path: '/respondentes', label: 'Respondentes', icon: <UsersIcon /> },
      ];
    } else if (isCliente) {
      return [
        { path: '/home', label: 'Início', icon: <HomeIcon /> },
        { path: '/responder', label: 'Questionários', icon: <DocumentIcon /> },
        { path: '/meus-resultados', label: 'Respostas', icon: <ChartIcon /> },
      ];
    } else {
      return [
        { path: '/', label: 'Início', icon: <HomeIcon /> },
        { path: '/responder', label: 'Questionários', icon: <DocumentIcon /> },
        { path: '/login', label: 'Entrar', icon: <KeyIcon /> },
      ];
    }
  };

  const navItems = getNavItems();

  return (
    <header className="sr-header">
      {/* Logo and Title */}
      <div className="brand" onClick={() => navigate('/')} style={{ cursor: 'pointer' }}>
        <div className="logo" />
        <div>
          <div className="title">Questionários SEBRAE</div>
          {subtitle && <div className="subtitle">{subtitle}</div>}
        </div>
      </div>

      {/* Navigation Menu */}
      <nav className="header-nav">
        {navItems.map(item => (
          <button
            key={item.path}
            className={`nav-item ${location.pathname === item.path ? 'active' : ''}`}
            onClick={() => navigate(item.path)}
          >
            <span className="nav-icon">{item.icon}</span>
            <span className="nav-label">{item.label}</span>
          </button>
        ))}
      </nav>

      {/* Search */}
      <div className="header-center">
        {user && (
          <div className={`search-container ${showSearch ? 'expanded' : ''}`}>
            <button 
              className="search-toggle" 
              onClick={() => setShowSearch(!showSearch)}
              title="Buscar"
            >
              <SearchIcon size={18} />
            </button>
            {showSearch && (
              <input 
                type="text" 
                placeholder="Buscar questionários..."
                value={searchQuery}
                onChange={(e) => setSearchQuery(e.target.value)}
                className="search-input"
                autoFocus
              />
            )}
          </div>
        )}
      </div>

      {/* Actions: Bell, Profile, Logout */}
      <div className="actions">
        {user && (
          <>
            <button className="sr-bell" title="Notificações">
              <BellIcon size={18} />
              <span className="badge">0</span>
            </button>
            <div className="user-profile" onClick={() => navigate('/perfil')} title="Ver perfil">
              <img 
                src={user.avatarUrl || 'https://via.placeholder.com/32'} 
                alt={user.name} 
                className="avatar" 
              />
              <span className="user-name">{user.name}</span>
            </div>
            <button className="logout-btn" onClick={() => onLogout && onLogout()} title="Sair">
              <LogoutIcon size={18} />
            </button>
          </>
        )}
        {!user && (
          <button className="primary" onClick={() => onLogin && onLogin()}>
            Entrar
          </button>
        )}
      </div>
    </header>
  );
}
